var http=require("http"),url=require("url"),server=http.createServer(function(e,r){r.writeHead(200,{"Content-Type":"text/html"}),r.write("<h1>Dados da query string</h1>");var t=url.parse(e.url,!0);for(var n in t.query)r.write("<h2>"+n+" : "+t.query[n]+"</h2>");r.end()});server.listen(3e3,function(){console.log("server http !")});